\f0\fs18 \cf2 Eine weitere M\'f6glichkeit, Struktur herauszubilden ist der Kreis: ist eine teilautonome und selbststeuernde Gruppe gleichgestellter Personen, die gemeinsam eine Dom\'e4ne verantworten.\
Ein Kreis kann andauernd oder zeitlich begrenzt bestehen, ist selbst f\'fcr seine Entwicklung verantwortlich.\

\f1 Teilautonomie
